import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 64.2-1213 Effect of confirmation of report.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-1213.md","filePath":"vacode/64.2-1213.md"}'),a={name:"vacode/64.2-1213.md"},i=r('<h1 id="§-64-2-1213-effect-of-confirmation-of-report" tabindex="-1">§ 64.2-1213 Effect of confirmation of report. <a class="header-anchor" href="#§-64-2-1213-effect-of-confirmation-of-report" aria-label="Permalink to &quot;§ 64.2-1213 Effect of confirmation of report.&quot;">​</a></h1><p>The report, to the extent to which it is confirmed by an order of the circuit court upon exceptions filed pursuant to subsection B of § <a href="http://law.lis.virginia.gov/vacode/64.2-1212/" target="_blank" rel="noreferrer">64.2-1212</a> or in whole when confirmed by lapse of time without exceptions pursuant to subsection A of § <a href="http://law.lis.virginia.gov/vacode/64.2-1212/" target="_blank" rel="noreferrer">64.2-1212</a>, shall be taken to be correct, except so far as it may, in a suit, in proper time, be surcharged or falsified. However, no person who was a party to exceptions filed to the report shall bring a suit to surcharge or falsify the report, and in such case the action of the court on the report shall be final as to such party, except that it may be appealed from as in other suits.</p><p>Code 1919, § 5429; 1932, p. 554; 1944, p. 107; Code 1950, § 26-34; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0614" target="_blank" rel="noreferrer">614</a>.</p>',3),n=[i];function c(f,s,p,h,l,d){return t(),o("div",null,n)}const m=e(a,[["render",c]]);export{u as __pageData,m as default};
